import React from 'react';
import './Community.css';

function Community() {
  return (
    <section id="community">
      <h2>Спільнота</h2>
      <p className="community-description">
        Наша спільнота — це місце для обміну ідеями, порадами та натхненням. Ми віримо, що разом легше досягати цілей!
        Поділись своїм враженням або мотиваційним коментарем нижче.
      </p>

      <input type="text" id="comment-input" placeholder="Введіть коментар..." />
      <button id="comment-button">Опублікувати</button>
      <ul id="comment-list">
        <li>"Маленькі кроки ведуть до великих результатів!" </li>
        <li>"Рекомендую книгу 'Атомні звички' – дуже мотивує!" </li>
        <li>"Головне – ставити реальні цілі і нагороджувати себе!" – Іван</li>
        <li>"Неймовірний сайт! Заслуговує найвищого балу" – Тоня</li>
      </ul>
    </section>
  );
}

export default Community;
